  function readFile() {
    if($(".selectedImages").length >= 2) {
      alert("您最多只能上載兩張照片。");
      return;
    }
    
    if (this.files && this.files[0]) {
      
      var FR= new FileReader();
      
      FR.addEventListener("load", function(e) {
        $(".imageView").html($(".imageView")[0].innerHTML + "<div data='" + e.target.result + "' width=150px height=150px class='selectedImages' style='background-image:url(\""+e.target.result+"\")'>" +
                            "<a href='javascript:removeImg(\""+e.target.result+"\")'>移除</a></div>")
        // document.getElementById("img").src       = e.target.result;
        // document.getElementById("b64").innerHTML = e.target.result;
      }); 
      
      FR.readAsDataURL( this.files[0] );
    }
    
  }
  
  function recSubmit() {
    var Name = $("input[name=name]")[0].value;
    var Address = $("input[name=address]")[0].value;
    var Latitude = $("input[name=latitude]")[0].value;
    var Longitude = $("input[name=longitude]")[0].value;
    var Remark = $("input[name=remark]")[0].value;
    var Images = [];
    if(Name == "" || Remark == "") {
      alert("請完整填寫資訊！");
      return;
    }else{
      if((Latitude == "" || Latitude == undefined || Latitude == null) && Address == "") {
          alert("請完整填寫資訊！");
          return;
        }
    }
    if($(".selectedImages")[0] == undefined) {
      alert("您必須拍攝至少一張照片！");
      return;
    }
    var r = confirm("我們正在對圖片進行壓縮，可能需要一些時間，如果可以開始請按下確認按鈕。");
    if(r!=true)return;
    $(".selectedImages").each(function(index){
      Images.push(LZString.compress($(".selectedImages")[index].getAttribute("data")));
    });
    
    var Dict = {
      Name: Name,
      AddressText: Address,
      AddressRec: {
        Latitude: Latitude,
        Longitude: Longitude
      },
      Remark: Remark,
      Image: Images
    }
    
    // console.log(JSON.stringify(Dict));
    
    if(localStorage.getItem("myData") == undefined) {
      localStorage.setItem("myData", "");
    }
    if(localStorage.getItem("myData") != "") {
      localStorage.setItem("myData", localStorage.getItem("myData") + "," + JSON.stringify(Dict));
    }else{
      localStorage.setItem("myData", localStorage.getItem("myData") + JSON.stringify(Dict));
    }
    console.log(JSON.parse("["+localStorage.getItem("myData")+"]"));

    $("input[name=name]")[0].value = "";
    $("input[name=address]")[0].value = "";
    $("input[name=latitude]")[0].value = "";
    $("input[name=longitude]")[0].value = "";
    $("input[name=remark]")[0].value = "";
    $(".selectedImages").remove();
    $(".lity-close")[0].click();
    alert("數據儲存成功！");
  
  }
  
  
